name: Autograding Tests
'on': push
permissions:
  checks: write
  actions: read
  contents: read
jobs:
  run-autograding-tests:
    runs-on: ubuntu-latest
    if: github.actor != 'github-classroom[bot]'
    steps:
      - name: Checkout code
        uses: actions/checkout@v4

      # Test Item in Linked List
      - name: Test Item in Linked List
        id: test-item-in-ll
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Test Item in Linked List
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestItemInLL
          timeout: 10
          max-score: 10

      # Test Reverse Linked List
      - name: Test Reverse Linked List
        id: test-reverse-ll
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Test Reverse Linked List
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestReverseLL
          timeout: 10
          max-score: 10

      # Test Interleave Linked Lists
      - name: Test Interleave Linked Lists
        id: test-interleave-lls
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Test Interleave Linked Lists
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestInterleaveLLs
          timeout: 10
          max-score: 10

      # Test Remove Item from Linked List
      - name: Test Remove Item from Linked List
        id: test-remove-item
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Test Remove Item from Linked List
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestRemoveItem
          timeout: 10
          max-score: 10

      # Test Remove Index from Linked List
      - name: Test Remove Index from Linked List
        id: test-remove-index
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Test Remove Index from Linked List
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestRemoveIndex
          timeout: 10
          max-score: 10

      # Test Remove Head from Linked List
      - name: Test Remove Head from Linked List
        id: test-remove-head
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Test Remove Head from Linked List
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestRemoveHead
          timeout: 10
          max-score: 10

      # Test Remove Tail from Linked List
      - name: Test Remove Tail from Linked List
        id: test-remove-tail
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Test Remove Tail from Linked List
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestRemoveTail
          timeout: 10
          max-score: 10

      # Test Remove Duplicates from Linked List
      - name: Test Remove Duplicates from Linked List
        id: test-remove-duplicates
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Test Remove Duplicates from Linked List
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestRemoveDuplicates
          timeout: 10
          max-score: 10

      # Test Is Tree BST
      - name: Test Is Tree BST
        id: test-is-tree-bst
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Test Is Tree BST
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestIsTreeBST
          timeout: 10
          max-score: 10

      # Test Search Binary Tree
      - name: Test Search Binary Tree
        id: test-search-binary-tree
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Test Search Binary Tree
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.SearchBinaryTree
          timeout: 10
          max-score: 10

      # Test Search BST
      - name: Test Search BST
        id: test-search-bst
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Test Search BST
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestSearchBST
          timeout: 10
          max-score: 10

      # Test Insert BST
      - name: Test Insert BST
        id: test-insert-bst
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Test Insert BST
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestInsertBST
          timeout: 10
          max-score: 10

      # Test BST Min
      - name: Test BST Min
        id: test-bst-min
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Test BST Min
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestBSTMin
          timeout: 10
          max-score: 10

      # Test BST Max
      - name: Test BST Max
        id: test-bst-max
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Test BST Max
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestBSTMax
          timeout: 10
          max-score: 10

      # Test BFS
      - name: Test BFS
        id: test-bfs
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Test BFS
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestBFS
          timeout: 10
          max-score: 30

      # Test Path Exists
      - name: Test Path Exists
        id: test-path-exists
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Test Path Exists
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestPathExists
          timeout: 10
          max-score: 30

      # Test Shortest Path
      - name: Test Shortest Path
        id: test-shortest-path
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Test Shortest Path
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestShortestPath
          timeout: 10
          max-score: 30

      # Autograding Reporter
      - name: Autograding Reporter
        uses: classroom-resources/autograding-grading-reporter@v1
        env:
          TEST-ITEM-IN-LL_RESULTS: "${{steps.test-item-in-ll.outputs.result}}"
          TEST-REVERSE-LL_RESULTS: "${{steps.test-reverse-ll.outputs.result}}"
          TEST-INTERLEAVE-LLS_RESULTS: "${{steps.test-interleave-lls.outputs.result}}"
          TEST-REMOVE-ITEM_RESULTS: "${{steps.test-remove-item.outputs.result}}"
          TEST-REMOVE-INDEX_RESULTS: "${{steps.test-remove-index.outputs.result}}"
          TEST-REMOVE-HEAD_RESULTS: "${{steps.test-remove-head.outputs.result}}"
          TEST-REMOVE-TAIL_RESULTS: "${{steps.test-remove-tail.outputs.result}}"
          TEST-REMOVE-DUPLICATES_RESULTS: "${{steps.test-remove-duplicates.outputs.result}}"
          TEST-IS-TREE-BST_RESULTS: "${{steps.test-is-tree-bst.outputs.result}}"
          TEST-SEARCH-BINARY-TREE_RESULTS: "${{steps.test-search-binary-tree.outputs.result}}"
          TEST-SEARCH-BST_RESULTS: "${{steps.test-search-bst.outputs.result}}"
          TEST-INSERT-BST_RESULTS: "${{steps.test-insert-bst.outputs.result}}"
          TEST-BST-MIN_RESULTS: "${{steps.test-bst-min.outputs.result}}"
          TEST-BST-MAX_RESULTS: "${{steps.test-bst-max.outputs.result}}"
          TEST-BFS_RESULTS: "${{steps.test-bfs.outputs.result}}"
          TEST-PATH-EXISTS_RESULTS: "${{steps.test-path-exists.outputs.result}}"
          TEST-SHORTEST-PATH_RESULTS: "${{steps.test-shortest-path.outputs.result}}"
        with:
          runners: >
            test-item-in-ll,
            test-reverse-ll,
            test-interleave-lls,
            test-remove-item,
            test-remove-index,
            test-remove-head,
            test-remove-tail,
            test-remove-duplicates,
            test-is-tree-bst,
            test-search-binary-tree,
            test-search-bst,
            test-insert-bst,
            test-bst-min,
            test-bst-max,
            test-bfs,
            test-path-exists,
            test-shortest-path